  function collectBill(e){

    console.log(e.target.value);
    setBill(e.target.value);

  }

  

  
  function handleSubmit(e){

     e.preventDefault();
     setDisplay(true);
     setArea(area-val)
  
  }

  return (
    <div className='profile-main'>
    <div className='profile'>
      
        <div>

        </div>
    
    <div className='add-crop'>
       <h1>Add Crop</h1>
       <form onSubmit={handleSubmit}>
