            <option value='mango'>mango</option>
            <option value='banna'>banna</option>
            <option value='orange'>orange</option>
         </select>
         <br></br>
         
     
    
       </form>
      


    
    </div>

    {/* <Data 
      
farea={area}
croptype={cropname}
cropPhoto={imgcrop}
billPhoto={bill}
    ></Data>
    */}

    </div>
    </div>
  )
}

export default Profile;
